import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <div className="form-control">
                </div>
                <div className="form-control">
                    <button class="button"><span class="fa fa-star"></span> Checkout <span class="fa fa-star"></span></button>
                </div>
            </header>
        </div>
    );
}

export default App;
